// Components
import LoginContainer from "./components/login/LoginContainer.react.js";
import ApplicantLogin from "./components/applicant/login/ApplicantLogin.js";
import ApplicantSignup from "./components/applicant/signup/ApplicantSignup.js";
import EmployerLogin from "./components/employer/login/EmployerLogin.js";
import EmployerSignup from "./components/employer/signup/EmployerSignup.js";
import Home from "./components/home/Home.js";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';



// css
import "./App.css";

// React
import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

// Backend
import { getHelloWorldMessageService } from "./services/HelloWorldServices";

// TODO: should probably move all routing to a separate file


function App() {
  return (
    <Router>
      <div>
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="/">New Job Board Application</Navbar.Brand>
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="/">Home</Nav.Link>
              <Nav.Link href="/about">About</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        <Route path="/" exact component={Home} />
        <Route path="/employer" component={Employer} />
        <Route path="/applicant" component={Applicant} />
        <Route path="/about" component={About} />
      </div>
    </Router>
  );
}

function NotHome() {
  const handleButtonClick = () => {
    getHelloWorldMessageService()
      .then((response) => {
        response.json().then((data) => {
          console.log(data);
        });
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div >
      <LoginContainer />
      <button onClick={handleButtonClick}>click to connect to backend </button>
    </div>
  );
}

function About() {
  console.log("about");
  return <h2>About</h2>;
}

function Employer() {
  return (
    <Router>
      <Switch>
        <Route path="/employer/" exact>
          <h2>Hello Employer</h2>
        </Route>
        <Route path="/employer/signup" component={EmployerSignup}>
          <h2>Employer Signup</h2>
        </Route>
        <Route path="/employer/login">
          <h2>Employer Login</h2>
        </Route>
      </Switch>
    </Router>
  );
}

function Applicant() {
  return (
    <Router>
      <Switch>
        <Route path="/applicant">
          <h2>Hello Applicant</h2>
        </Route>
        <Route path="/applicant/signup">
          <h2>Applicant Signup</h2>
        </Route>
        <Route path="/applicant/login">
          <h2>Applicant Login</h2>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
